import React, {useEffect, useState} from 'react';
import { useCart } from '../../context/CartContext';
import { useNavigate } from 'react-router-dom';

const PaymentPage: React.FC = () => {
    const { items, total, clearCart, setPaymentMethod, placeOrder, setShippingAddress } = useCart();
    const [shippingAddress, setShippingAddressState] = useState({
        firstName: '',
        lastName: '',
        street: '',
        city: '',
        postalCode: '',
        country: '',
        telephone: ''
    });


    const [paymentMethod, setPaymentMethodState] = useState("checkmo");
    const [error, setError] = useState<string | null>(null);
    const [isLoading, setIsLoading] = useState(false);
    const navigate = useNavigate();

    const handleShippingChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        const { name, value } = e.target;
        setShippingAddressState((prev) => ({ ...prev, [name]: value }));
    };

    const handlePaymentMethodChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setPaymentMethodState(e.target.value);
    };

    const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        setIsLoading(true);
        setError(null);

        try {
            await setShippingAddress(shippingAddress);
            await setPaymentMethod(paymentMethod);
            const orderNumber = await placeOrder();

            if (orderNumber) {
                clearCart();
                navigate(`/order/${orderNumber}`); // Przekierowanie do strony zamówienia
            } else {
                setError("Wystąpił problem z przetworzeniem zamówienia.");
            }
        } catch (error) {
            setError("Wystąpił błąd podczas składania zamówienia.");
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div>
            <h2>Płatność</h2>
            <form onSubmit={handleSubmit}>
                <h3>Adres dostawy</h3>
                <input name="firstName" placeholder="Imię" value={shippingAddress.firstName} onChange={handleShippingChange} required />
                <input name="lastName" placeholder="Nazwisko" value={shippingAddress.lastName} onChange={handleShippingChange} required />
                <input name="street" placeholder="Ulica" value={shippingAddress.street} onChange={handleShippingChange} required />
                <input name="city" placeholder="Miasto" value={shippingAddress.city} onChange={handleShippingChange} required />
                <input name="postalCode" placeholder="Kod pocztowy" value={shippingAddress.postalCode} onChange={handleShippingChange} required />
                <input name="country" placeholder="Kraj" value={shippingAddress.country} onChange={handleShippingChange} required />
                <input name="telephone" placeholder="Telefon" value={shippingAddress.telephone} onChange={handleShippingChange} required />

                <h3>Metoda płatności</h3>
                <label>
                    <input type="radio" value="checkmo" checked={paymentMethod === 'checkmo'} onChange={handlePaymentMethodChange} />
                    Płatność przy odbiorze
                </label>
                <label>
                    <input type="radio" value="banktransfer" checked={paymentMethod === 'banktransfer'} onChange={handlePaymentMethodChange} />
                    Przelew bankowy
                </label>

                {error && <div style={{ color: 'red' }}>{error}</div>}
                <button type="submit" disabled={isLoading}>
                    {isLoading ? 'Przetwarzanie...' : 'Złóż zamówienie'}
                </button>
            </form>
            <h3>Podsumowanie zamówienia</h3>
            <ul>
                {items.map(item => (
                    <li key={item.itemId}>
                        {item.name} - {item.quantity} x {item.price} PLN
                    </li>
                ))}
            </ul>
            <p>Całkowity koszt: {total} PLN</p>
        </div>
    );
};

export default PaymentPage;
